		"lang": "ko",
		"text": "설치 비용, 노동력이 개인적으로 많이 소모되는 것은 둘째치고, 한 푼도 주지 않으면서 갤러리 홍보효과까지 갖고 싶어하는 경우가 대부분이고, '예술인 인증인가 뭔가 받으려면 전시 확인증 있어야 한다면서요?'라며 생색내는 경우도 많은데, 너무 폭력적인 자세라 생각한다. 개선이 됐으면 좋겠지만"
