		"text": "항상 어떤 일이든 전달받았고, 제가 뭔가에 대한 답을 받으려면 기다려야했습니다. 기다리는 것도 6개월 정도 했더니 돌아버릴 것 같았습니다. 진전은 없었고 영화제에서 원하는 방향으로 저를 움직이려고 했습니다. 저는 하나도 나아진 게 없는 상황이 반복되자 정말 죽고 싶었습니다. https://t.co/a3QMR4kzBC"
