		"text": "대형 기획사에서 챌린지 플랫폼 따로 좀 만들었으면 좋겠다. 아니면 인스턴트 숏폼 플랫폼 인수 좀 해주세요. \n\n유튜브에도 숏폼형태의 동영상 업로드 지원하는데 틱톡에만 올리지 말고 같이 올리면 안 되는 것인지."
